prompt: "Q: Write python code to solve the following coding problem that obeys the\
  \ constraints and passes the example test cases. The output code needs to read from\
  \ and write to standard IO. Please wrap your code answer using ```:\nThere are N\
  \ integers written on a blackboard. The i-th integer is A_i.\n\nTakahashi and Aoki\
  \ will arrange these integers in a row, as follows:\n\n* First, Takahashi will arrange\
  \ the integers as he wishes.\n* Then, Aoki will repeatedly swap two adjacent integers\
  \ that are coprime, as many times as he wishes.\n\n\n\nWe will assume that Takahashi\
  \ acts optimally so that the eventual sequence will be lexicographically as small\
  \ as possible, and we will also assume that Aoki acts optimally so that the eventual\
  \ sequence will be lexicographically as large as possible. Find the eventual sequence\
  \ that will be produced.\n\nConstraints\n\n* 1 \u2266 N \u2266 2000\n* 1 \u2266\
  \ A_i \u2266 10^8\n\nInput\n\nThe input is given from Standard Input in the following\
  \ format:\n\n\nN\nA_1 A_2 \u2026 A_N\n\n\nOutput\n\nPrint the eventual sequence\
  \ that will be produced, in a line.\n\nExamples\n\nInput\n\n5\n1 2 3 4 5\n\n\nOutput\n\
  \n5 3 2 4 1\n\n\nInput\n\n4\n2 3 4 6\n\n\nOutput\n\n2 4 6 3\nA: ```import sys\n\
  sys.setrecursionlimit(1000000000)\n\ndef gcd(a: int, b:int):\n    while b:\n   \
  \     a,b=b,a%b\n    return a\n\ndef merge(a,us,vs):\n    i,j,res=0,0,[]\n    while\
  \ i<len(us) and j<len(vs):\n        if a[us[i]]>=a[vs[j]]:\n            res.append(us[i])\n\
  \            i+=1\n        else:\n            res.append(vs[j])\n            j+=1\n\
  \    return res+us[i:]+vs[j:]\n\ndef dfs(g,a,u,vis):\n    vis[u]=True\n    res=[]\n\
  \    for v in g[u]:\n        if not vis[v]:\n            res=merge(a,res,dfs(g,a,v,vis))\n\
  \    return [u]+res\n\nwhile 1:\n    try:\n        n=int(input())\n        a=sorted(map(int,input().split()))\n\
  \    except: break\n\n    g=[[] for _ in range(n)]\n    for i in range(n):\n   \
  \     for j in range(i+1,n):\n            if gcd(a[i],a[j])!=1:\n              \
  \  g[i].append(j)\n                g[j].append(i)\n\n    vis=[False]*n\n    res=[]\n\
  \    for u in range(n):\n        if not vis[u]:\n            res=merge(a,res,dfs(g,a,u,vis))\n\
  \    print(' '.join(str(a[u]) for u in res))```\nQ: Write python code to solve the\
